-- Class constructor

local Class = function(...)
    local cls = {}
    cls.__index = cls
    function cls:New(...)
        local instance = setmetatable({}, cls)
        cls.__init(instance, ...)
        return instance
    end
    cls.__call = function(_, ...) return cls:New(...) end
    return setmetatable(cls, {__call = cls.__call})
end

-- Utils

local function RoundDown(value, multiple, offset)
    local remain = (value + offset) % multiple
    return value >= 0 and (value - remain)
        or -(math.abs(value) + remain)
end

local function RoundUp(value, multiple, offset)
    local remain = (value + offset) % multiple
    return value >= 0 and (value + multiple -
        remain) or -(math.abs(value) - remain)
end

