    if self.map == HOWLING_ABYSS then
        local rx = RoundDown(x, 5.0, 4.0)
        local ry = RoundUp(y, 5.0, 4.0)
        return self.bushes[rx] ~= nil and
            self.bushes[rx][ry] ~= nil
    end
    local rx = RoundDown(x, 5.0, 0.0)
    local ry = RoundUp(y, 5.0, 2.0)
    return self.bushes[rx] ~= nil and
        self.bushes[rx][ry] ~= nil
end

function MapLibrary:IsRiver(x, y)
    if self.map == HOWLING_ABYSS
        then return false end
    local x, y = x * 0.1, y * 0.1
    local rx = RoundDown(x, 1.0, 0.0)
    local ry = RoundUp(y, 1.0, 0.0)
    return self.rivers[rx] ~= nil and
        self.rivers[rx][ry] ~= nil
end

function MapLibrary:IsWall(x, y)
    local x, y = x * 0.1, y * 0.1
    if self.map == HOWLING_ABYSS then
        local rx = RoundDown(x, 5.0, 4.0)
        local ry = RoundUp(y, 5.0, 4.0)
        return (self.grounds[rx] == nil or
            self.grounds[rx][ry] == nil)
            and (self.bushes[rx] == nil or
            self.bushes[rx][ry] == nil)
    end
    local rx = RoundDown(x, 5.0, 0.0)
    local ry = RoundUp(y, 5.0, 2.0)
    return self.walls[rx] ~= nil and
        self.walls[rx][ry] ~= nil
end

return MapLibrary
